  `medications` mediumtext,
  `comments` varchar(255) DEFAULT NULL,
  `treatment` mediumtext,
  `recommended_by` int(11) DEFAULT NULL,
  `approved_by` int(11) DEFAULT NULL,
  `sent_by` int(11) DEFAULT NULL,
